css:
.github-FilePatchListView:empty:before {
  content: 'No changes';
  display: block;
  padding: 14px;
  text-align: center;
  color: #797979;
  font-style: italic;
}
.github-FilePatchListView-item {
  position: relative;
  display: flex;
  align-items: flex-start;
  padding: 7px 14px;
  padding-left: 49px;
  overflow: hidden;
  -webkit-user-select: none;
  cursor: default;
}
.github-FilePatchListView-icon {
  text-align: right;
}
.github-FilePatchListView-icon:before {
  margin-right: 11.66666667px;
}
.github-FilePatchListView-path {
  flex: 1;
  word-break: break-word;
}
.github-FilePatchListView-resolutionItem {
  padding-top: 0;
  padding-bottom: 7px;
}
.github-MergeConflictPaths .github-FilePatchListView-icon:last-child {
  margin-left: 7px;
}
